script: |
  super -f text -I q11036.spq | sort > q11036.out

inputs:
  - name: q11036.spq
    data: |
      SELECT DISTINCT - col0 FROM tab0 (FORMAT parquet) WHERE NOT + + 5 - - + ( + + col0 ) + + ( col2 ) * + + 31 + ( col1 ) BETWEEN col1 * col2 AND - col2;
  - name: tab0

outputs:
  - name: q11036.out
    data: |
      -15
      -87
      -97
